import{_ as e,o as t,c as i,O as a}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 30-65 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/30-65.md","filePath":"vacode/30-65.md"}'),n={name:"vacode/30-65.md"},o=a('<h1 id="§-30-65-definitions" tabindex="-1">§ 30-65 Definitions. <a class="header-anchor" href="#§-30-65-definitions" aria-label="Permalink to &quot;§ 30-65 Definitions.&quot;">​</a></h1><p>As used in this chapter, the terms below shall be interpreted as follows:</p><ol><li><p>The term &quot;agency&quot; means any agency, authority, board, department, division, commission, institution, bureau, or like governmental entity of the Commonwealth and includes any entity, public or private, with which any of the foregoing has entered into a contractual relationship to accomplish an agency program.</p></li><li><p>The term &quot;functional area&quot; means that grouping of state governmental activities, programs, and agencies which constitute a single budget function as identified and classified in the Virginia State Government Program Structure.</p></li><li><p>The term &quot;discretionary selection&quot; refers to the procedure set forth in § <a href="http://law.lis.virginia.gov/vacode/30-67/" target="_blank" rel="noreferrer">30-67</a> whereby programs and agencies, contained wholly or in part within functional areas, are selected for legislative review and evaluation under the provisions of this chapter.</p></li></ol><p>1978, c. 388.</p>',4),r=[o];function s(c,l,d,h,p,u){return t(),i("div",null,r)}const _=e(n,[["render",s]]);export{m as __pageData,_ as default};
